--1. Utilice la base de datos Northwind
use Northwind
go

--2. Realice un full backup de la base de datos, adjunte captura

--backup completo de la base de datos
backup database Northwind to disk = 'C:\ADBD\Backup\Lab13AdrianaDiazVargas.bak' ;

--3. Inserte 1000 registros a la tabla customers, adjunte captura

--4. Realice un respaldo diferencial de la base de datos, adjunte captura
BACKUP DATABASE Northwind TO DISK = 'C:\ADBD\Backup\Lab13AdrianaDiazVargas.bak'
WITH DIFFERENTIAL;

--5. Elimine la base de datos Northwind, adjunte captura
drop database Northwind
go

--6. Restaure el full backup, adjunte captura
-- Restaurar el full backup
ALTER DATABASE Northwind SET SINGLE_USER WITH ROLLBACK IMMEDIATE;
GO
RESTORE DATABASE Northwind 
FROM DISK = 'C:\ADBD\Backup\Lab13AdrianaDiazVargas.bak'
WITH 
    FILE = 1,
    NORECOVERY,   -- Para poder restaurar backup diferencial después
    REPLACE;      -- Para sobrescribir
GO

--7. Restaure el respaldo diferencial, adjunte captura
restore database Northwind FROM DISK = 'C:\ADBD\Backup\Lab13AdrianaDiazVargas.bak'
WITH 
    FILE = 2, 
    RECOVERY;-- Finaliza y deja operativa la base
GO

